import React from 'react';
import { Grid, Card, CardContent, Typography, Box } from '@mui/material';
import TrendingUpIcon from '@mui/icons-material/TrendingUp';
import SavingsIcon from '@mui/icons-material/Savings';
import ShieldIcon from '@mui/icons-material/Shield';
import ShowChartIcon from '@mui/icons-material/ShowChart';

export default function FinancialOverview({ data }) {
  // Extract values from real data
  const netWorth = data.fetch_net_worth?.netWorthResponse?.totalNetWorthValue?.units || '—';
  const investments = data.fetch_net_worth?.netWorthResponse?.assetValues?.find(a => a.netWorthAttribute === 'ASSET_TYPE_MUTUAL_FUND')?.value?.units || '—';
  const savings = data.fetch_bank_transactions?.accounts?.reduce((sum, acc) => sum + (parseFloat(acc.balance) || 0), 0) || '—';
  const insurance = '₹2,50,00,000'; // Placeholder, update if you have insurance data

  const cards = [
    { label: 'Total Net Worth', value: `₹${netWorth}`, change: '+3.2%', icon: <TrendingUpIcon color="primary" fontSize="large" /> },
    { label: 'Investments', value: `₹${investments}`, change: '+5.7%', icon: <ShowChartIcon color="success" fontSize="large" /> },
    { label: 'Savings', value: `₹${savings}`, change: '+1.2%', icon: <SavingsIcon color="secondary" fontSize="large" /> },
    { label: 'Insurance Coverage', value: insurance, change: '', icon: <ShieldIcon color="warning" fontSize="large" /> },
  ];

  return (
    <Grid container spacing={2} mb={2}>
      {cards.map((item) => (
        <Grid item xs={12} sm={6} md={3} key={item.label}>
          <Card sx={{ borderRadius: 3, boxShadow: 0 }}>
            <CardContent>
              <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                {item.icon}
                <Typography variant="subtitle2" color="text.secondary">{item.label}</Typography>
              </Box>
              <Typography variant="h6" fontWeight={700}>{item.value}</Typography>
              <Typography variant="body2" color={item.change.startsWith('+') ? 'green' : 'red'}>
                {item.change}
              </Typography>
            </CardContent>
          </Card>
        </Grid>
      ))}
    </Grid>
  );
}
